,p_javascript_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'let G_score = 0;',
'function isInputNumber(evt){               ',
'    var ch = String.fromCharCode(evt.which);          ',
'    if(!(/[0-9]/.test(ch))){',
'        evt.preventDefault();',
'    }    ',
'}',
'',
'//because the max value is 170, we say that the winner is the one with more than 85 points',
'function isWin(){',
'    if (G_score > 85){',
'       ',
'        return true;',
'        ',
'    }',
'    else { return false;}',
'}',
'',
'function setScore(pnumber, s){',
'    let t  = 0;',
'    let mypage = document.getElementById("comptage");',
'    ',
'        if (apex.item(pnumber).getValue() === null) {',
'            t=0',
'        } ',
'        else {',
'            t=apex.item(pnumber).getValue();',
'            t = t*1;',
'        };',
'        ',
'        if (s==''plus''){',
'        apex.item( pnumber ).setValue(t+1);',
'        }',
'        else',
'        {',
'            if (t>0){   ',
'            apex.item( pnumber ).setValue(t-1); ',
'            }  ',
'        }',
'       ',
'        G_score = $v("P20")*20+$v("P3")*10+$v("P5")*5 +$v("PJ")*3+$v("P2")*2;',
'        ',
'        // we render entire region in gree color for alerting that the gamer won ',
'        if (isWin() == true) {',
'            mypage.classList.add("u-color-20-bg");',
'        }',
'        else',
'        {',
'            mypage.classList.remove("u-color-20-bg");',
'',
'        }',
'        apex.item( "SCORE" ).setValue(G_score);',
'',
'}      ',
'',
''))
